<p>–ù–∞—Å –∑–¥–∏–≤—É–≤–∞–ª–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å —Ç–∞–∫–æ–≥–æ –∑–∞—Ç–∏—à–Ω–æ–≥–æ —Ç–∞ —Å–º–∞—á–Ω–æ–≥–æ —Ä–µ—Å—Ç–æ—Ä–∞–Ω—É —É –º–∞–ª–µ–Ω—å–∫–æ–º—É –º—ñ—Å—Ç—ñ.</p><strong><a id='z2'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –ñ–æ–≤–∫–≤–∞</h2></strong><p>–ü—Ä–∏–≤—ñ—Ç–Ω–∞ –æ—Ñ—ñ—Ü—ñ–∞–Ω—Ç–∫–∞. –î–æ—Å–∏—Ç—å —è—Å–Ω–æ —Ä–æ–∑–ø–æ–≤—ñ–ª–∞ –Ω–∞–º, —á–∞–π–Ω–∏–∫–∞–º, –ø—Ä–æ —Å—Ç—Ä–∞–≤–∏. –ê –ø—ñ–∑–Ω—ñ—à–µ –ø—ñ–¥–∫–∞–∑–∞–ª–∞, —è–∫ —ó—Å—Ç–∏ —Ö–∞—á–∞–ø—É—Ä—ñ –ø–æ-–∞–¥–∂–∞—Ä—Å—å–∫–∏. –ê —è–∫ —Ç–∞–º —Å–º–∞—á–Ω–æ! –ö—É—Ä—á–∞ –ø–æ-—á–∫–º–µ—Ä—É–ª—å—Å—å–∫–∏ - —Ü–µ —â–æ—Å—å! –¢–∞–∫–æ–∂ —Ö–æ—á—É –≤—ñ–¥–º—ñ—Ç–∏—Ç–∏ –∫–æ–º—Ñ–æ—Ä—Ç —Ç–∞ —á–∏—Å—Ç–æ—Ç—É. –°—é–¥–∏ —Ö–æ—á–µ—Ç—å—Å—è –ø–æ–≤–µ—Ä–Ω—É—Ç–∏—Å—è, –Ω–∞ –∂–∞–ª—å –º–∏ –∂–∏–≤–µ–º–æ –¥–∞–ª–µ–∫–æ. –ù–∞–π–±—ñ–ª—å—à–µ —Å–ø–æ–¥–æ–±–∞–≤—Å—è —ñ—Å—Ç–æ—Ä–∏—á–Ω–∏–π —Ü–µ–Ω—Ç—Ä –º—ñ—Å—Ç–∞. –í—Å–µ —Å–∫–æ–Ω—Ü–µ—Ç—Ä–æ–≤–∞–Ω–æ –≤ —Ü–µ–Ω—Ç—Ä—ñ –º—ñ—Å—Ç–∞, –≤—Å–µ –¥—É–∂–µ –∑—Ä—É—á–Ω–æ —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω–æ, –ø–æ –∫–æ–ª—É. –ü–µ—Ä–µ—Å—É–≤–∞—Ç–∏—Å—å –∑—Ä—É—á–Ω–æ –ø—ñ—à–∫–∏. –í—Ä–∞–∂–∞—é—á–æ—ó –∫—Ä–∞—Å–∏ —Å–æ–±–æ—Ä–∏, –ø–ª–æ—â–∞, –∑–∞–º–æ–∫, —Ä–∞—Ç—É—à–∞. –°—ñ–Ω–∞–≥–æ–≥–∞ –∑–∞—á–∏–Ω–µ–Ω–∞ –Ω–∞ —Ä–µ–º–æ–Ω—Ç –≤–∂–µ –¥—É–∂–µ –±–∞–≥–∞—Ç–æ —Ä–æ–∫—ñ–≤, –∑–æ–≤–Ω—ñ –≤–∏–≥–ª—è–¥–∞—î –Ω–µ–ø—Ä–µ–∑–µ–Ω—Ç–∞–±–µ–ª—å–Ω–æ.</p>
